import "./App.scss";
import { Routes, Route } from "react-router-dom";
import Main from "./Routes/Main";
import Register from "./Routes/Register";

function App() {
  return (
    <div className="app">
      <Routes>
        <Route exact path="/" element={<Main />} />
        <Route exact path="/register" element={<Register />} />
      </Routes>
    </div>
  );
}

export default App;
